Anthony Albanese may have added years to his life by overhauling his diet and slashing his alcohol intake during his incredible weight loss journey.
The Prime Minister embarked on a fitness quest after being in a frightening car crash in January 2021, losing a whopping 18kg in less than a year by cutting out carbs, upping his exercise, and giving up alcohol for three months.&nbsp;
By March, the Labor leader had trimmed down to his goal of being under 80kgs, meaning he is no longer considered obese according to Body Mass Index measurements.

Hello Kitty, everyone’s favorite feline, is set to appear in her own big-screen feature in 2019.&nbsp;
The iconic face of coin purses, school supplies, and much, much more, is adjusting her famous red bow in preparation for her Hollywood debut. The popular cat will star in an animated movie that is set for release in 2019 through the recently established U.S. subsidiary of Japanese lifestyle company Sanrio, Deadline reports.
Already the star of her own television series, numerous video games, and Avril Lavigne’s 2013 song, the upcoming movie marks the bobtail cat’s biggest venture yet, with Sanrio execs estimating the budget to be between $160 million and $240 million.

